import React, { useState }  from "react";

const App = () =>{

  const [name,setName] = useState()
  const [name1,setnme1] = useState();
  const [pass,setPass] = useState();
  const [pass1,setPass1] = useState();

    function gettext(event){
        setName(event.target.value);
    }
   function get(){
       setnme1(name);
       setPass1(pass);
       document.getElementById("input").value = "";
       document.getElementById("pass").value = "";
   }
  function getpass(event){
     setPass(event.target.value);
  }

  return(
     <>
     <div>
         <h1>Hello {name1} {pass1}</h1>
         <input id="input" type="text" placeholder="enter Name" onChange={gettext}/>
         <input id="pass" type="text" placeholder="enter password" onChange={getpass}/>
         <button onClick={get}>Click Me</button>
     </div>
     </>
  );
}

export default App;
